import React from "react";
import styles from './HomepageText.module.css'

const HomepageText = () => {
    return (
        <div className={styles.text}>
            <div>Start</div>
            <div>Your</div>
            <div>Day</div>
            <h3>with</h3>
            <div>Matcha</div>
        </div>
    );
};

export default HomepageText;
